import Loader from '@hotel/components/Loader/Loader';
import ServiceOrderWrapper,{Title,SubTitle,Component} from './ServiceOrder.style'
  
const ServiceListing = () => {
    return (
        <ServiceOrderWrapper>
           <Title>THÔNG TIN ĐẶT LỊCH</Title>
           <Component>
           <SubTitle>Chọn Salon</SubTitle>
           <input type="text" id="fname" name="firstname" placeholder="Chọn salon"></input>
           <SubTitle>Dịch vụ</SubTitle>
           <input type="text" id="fname" name="firstname" placeholder="Sơn móng tay"></input>
           </Component>
           <Component>
           <SubTitle>Chọn thời gian</SubTitle>
           <input type="text" id="fname" name="firstname" placeholder="Sơn móng tay"></input>
           <SubTitle>Dịch vụ</SubTitle>
           <input type="text" id="fname" name="firstname" placeholder="Sơn móng tay"></input>

           <input type="text" id="fname" name="firstname" placeholder="Sơn móng tay"></input>
           </Component>
        </ServiceOrderWrapper>
    );
};
export default ServiceListing;
